-<br>prod deleted reportToClosing<br><br>INSERT INTO `ReportToClosing` (`id`, `reportId`, `reportType`, `reportPath`, `languageId`, `createdBy`, `createdDate`, `modifiedBy`, `modifiedDate`, `status`) VALUES\n(13504,	14733,	\'NORMAL\',	\'ANRWIP/CLOSED_REPORTS/NORMAL/2023-12-28/1703846272784_14214_14733_English.html\',	1,	25,	\'2023-12-29 10:37:53\',	25,	\'2023-12-29 10:37:53\',	0);<br><br><br><br><br><br><br><br><br><br><br><br><br></span></span></span></pre>',1,NULL,1,'2023-12-01 05:25:25','2024-01-04 06:20:31',4),(11,'File upload api example','<div class=\"whitespace-pre-wrap text-th-primary-dark antialiased break-words \">Sure, here\'s an example of a Spring Boot API that accepts a multipart file as a stream and saves it to the local file system:</div>\n<div class=\"grid bg-th-code-primary rounded overflow-hidden\">\n<div class=\"text-th-primary-dark opacity-100 flex bg-th-code-secondary px-4 justify-between items-center gap-2 py-1\">\n<p class=\"antialiased text-xs font-medium font-sans flex-1\">java</p>\n<div class=\"flex items-center font-sans gap-1 px-2 py-1 bg-transparent rounded-sm cursor-pointer hover:bg-white/[.08]\">\n<p class=\"antialiased text-xs\">Copy</p>\n</div>\n</div>\n<pre class=\"px-4 text-sm p-4 overflow-auto text-th-primary-dark opacity-100\"><code><span class=\"hljs-keyword\">import</span> org.springframework.web.bind.annotation.PostMapping;\n<span class=\"hljs-keyword\">import</span> org.springframework.web.bind.annotation.RequestParam;\n<span class=\"hljs-keyword\">import</span> org.springframework.web.bind.annotation.RestController;\n<span class=\"hljs-keyword\">import</span> org.springframework.web.multipart.MultipartFile;\n<span class=\"hljs-keyword\">import</span> java.io.FileOutputStream;\n<span class=\"hljs-keyword\">import</span> java.io.IOException;\n<span class=\"hljs-keyword\">import</span> java.io.InputStream;\n\n<span class=\"hljs-meta\">@RestController</span>\n<span class=\"hljs-keyword\">public</span> <span class=\"hljs-class\"><span class=\"hljs-keyword\">class</span> <span class=\"hljs-title\">FileUploadController</span> </span>{\n\n    <span class=\"hljs-meta\">@PostMapping(\"/upload\")</span>\n    <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> String <span class=\"hljs-title\">handleFileUpload</span><span class=\"hljs-params\">(<span class=\"hljs-meta\">@RequestParam(\"file\")</span> MultipartFile file)</span> </span>{\n        <span class=\"hljs-keyword\">if</span> (!file.isEmpty()) {\n            <span class=\"hljs-keyword\">try</span> {\n                String fileName = file.getOriginalFilename();\n                InputStream inputStream = file.getInputStream();\n                FileOutputStream outputStream = <span class=\"hljs-keyword\">new</span> FileOutputStream(<span class=\"hljs-string\">\"path/to/save/\"</span> + fileName);\n                <span class=\"hljs-keyword\">byte</span>[] buffer = <span class=\"hljs-keyword\">new</span> <span class=\"hljs-keyword\">byte</span>[<span class=\"hljs-number\">1024</span>];\n                <span class=\"hljs-keyword\">int</span> bytesRead;\n                <span class=\"hljs-keyword\">while</span> ((bytesRead = inputStream.read(buffer)) != -<span class=\"hljs-number\">1</span>) {\n                    outputStream.write(buffer, <span class=\"hljs-number\">0</span>, bytesRead);\n                }\n                outputStream.close();\n                inputStream.close();\n                <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"File uploaded successfully: \"</span> + fileName;\n            } <span class=\"hljs-keyword\">catch</span> (IOException e) {\n                <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"Failed to upload file: \"</span> + e.getMessage();\n            }\n        } <span class=\"hljs-keyword\">else</span> {\n            <span class=\"hljs-keyword\">return</span> <span class=\"hljs-string\">\"Failed to upload file: File is empty\"</span>;\n        }\n    }\n}\n</code></pre>\n</div>\n<div class=\"whitespace-pre-wrap text-th-primary-dark antialiased break-words \">In this example, we have a <span class=\"text-base antialiased bg-th-code-inline-background md:text-base border font-medium border-th-background-secondary cursor-pointer rounded-md text-th-code-inline-text px-1 py-[2px] select-all\">FileUploadController</span> with a <span class=\"text-base antialiased bg-th-code-inline-background md:text-base border font-medium border-th-background-secondary cursor-pointer rounded-md text-th-code-inline-text px-1 py-[2px] select-all\">handleFileUpload</span> method that accepts a <span class=\"text-base antialiased bg-th-code-inline-background md:text-base border font-medium border-th-background-secondary cursor-pointer rounded-md text-th-code-inline-text px-1 py-[2px] select-all\">MultipartFile</span> as a parameter. The method then saves the file to the local file system using an <span class=\"text-base antialiased bg-th-code-inline-background md:text-base border font-medium border-th-background-secondary cursor-pointer rounded-md text-th-code-inline-text px-1 py-[2px] select-all\">InputStream</span> and <span class=\"text-base antialiased bg-th-code-inline-background md:text-base border font-medium border-th-background-secondary cursor-pointer rounded-md text-th-code-inline-text px-1 py-[2px] select-all\">FileOutputStream</span>. The file is saved to the specified path with its original file name. If the file upload is successful, the method returns a success message; otherwise, it returns an error message.</div>',0,NULL,NULL,'2023-12-01 19:45:39','2023-12-12 11:16:26',4),(12,'Notepad','',0,NULL,1,'2023-12-08 09:14:34','2024-01-12 10:17:21',4),(13,'Youtube Importants','<p><iframe title=\"How principled coders outperform the competition\" src=\"https://www.youtube.com/embed/q1qKv5TBaOA\" width=\"779\" height=\"438\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-medi