br>&nbsp; &nbsp; SET sortOrder=9<br>&nbsp; &nbsp; WHERE id=26;<br>UPDATE ddc_case.testtypecasedefinitionmapper<br>&nbsp; &nbsp; SET sortOrder=6<br>&nbsp; &nbsp; WHERE id=21;<br>UPDATE ddc_case.testtypecasedefinitionmapper<br>&nbsp; &nbsp; SET sortOrder=15<br>&nbsp; &nbsp; WHERE id=23;<br>UPDATE ddc_case.testtypecasedefinitionmapper<br>&nbsp; &nbsp; SET sortOrder=5<br>&nbsp; &nbsp; WHERE id=20;<br>UPDATE ddc_case.testtypecasedefinitionmapper<br>&nbsp; &nbsp; SET sortOrder=14<br>&nbsp; &nbsp; WHERE id=22;<br>UPDATE ddc_case.testtypecasedefinitionmapper<br>&nbsp; &nbsp; SET sortOrder=7<br>&nbsp; &nbsp; WHERE id=24;<br>UPDATE ddc_case.testtypecasedefinitionmapper<br>&nbsp; &nbsp; SET sortOrder=8<br>&nbsp; &nbsp; WHERE id=25;<br><br><br><br><br>475<br>20.5<br>86<br><br>344 + 20.5 + 86 = 451<br><br><br><br></span></span></span></pre>',1,NULL,1,'2024-01-04 06:20:55','2024-01-12 09:34:35',4),(22,'Chrome Extension for catching download URL','<div class=\"fs-5\">\n<p class=\"text-black mb-2 text-break\">Creating a Chrome extension that catches a download and displays the URL involves several steps. Here\'s a step-by-step guide:</p>\n</div>\n<div class=\"fs-5\">\n<ol class=\"mb-2\">\n<li><strong>Create a Manifest File</strong></li>\n</ol>\n</div>\n<div class=\"fs-5\">\n<p class=\"text-black mb-2 text-break\">Every Chrome extension starts with a&nbsp;<code>manifest.json</code>&nbsp;file. This file provides important information to the browser about how to build and run your extension. Here\'s a basic&nbsp;<code>manifest.json</code>:</p>\n</div>\n<div class=\"fs-5\">&nbsp;</div>\n<div class=\"fs-5\">\n<div class=\"mt-3 p-1\">\n<div><code class=\"language-json\">  <span class=\"token\">{</span>\n    <span class=\"token\">\"manifest_version\"</span><span class=\"token\">:</span> <span class=\"token\">2</span><span class=\"token\">,</span>\n    <span class=\"token\">\"name\"</span><span class=\"token\">:</span> <span class=\"token\">\"Download Catcher\"</span><span class=\"token\">,</span>\n    <span class=\"token\">\"version\"</span><span class=\"token\">:</span> <span class=\"token\">\"1.0\"</span><span class=\"token\">,</span>\n    <span class=\"token\">\"description\"</span><span class=\"token\">:</span> <span class=\"token\">\"Catches and displays URLs of downloaded files\"</span><span class=\"token\">,</span>\n    <span class=\"token\">\"permissions\"</span><span class=\"token\">:</span> <span class=\"token\">[</span><span class=\"token\">\"downloads\"</span><span class=\"token\">]</span><span class=\"token\">,</span>\n    <span class=\"token\">\"background\"</span><span class=\"token\">:</span> <span class=\"token\">{</span>\n      <span class=\"token\">\"scripts\"</span><span class=\"token\">:</span> <span class=\"token\">[</span><span class=\"token\">\"background.js\"</span><span class=\"token\">]</span>\n    <span class=\"token\">}</span><span class=\"token\">,</span>\n    <span class=\"token\">\"browser_action\"</span><span class=\"token\">:</span> <span class=\"token\">{</span>\n      <span class=\"token\">\"default_title\"</span><span class=\"token\">:</span> <span class=\"token\">\"Show Download URL\"</span>\n    <span class=\"token\">}</span><span class=\"token\">,</span>\n    <span class=\"token\">\"icons\"</span><span class=\"token\">:</span> <span class=\"token\">{</span>\n      <span class=\"token\">\"16\"</span><span class=\"token\">:</span> <span class=\"token\">\"icon16.png\"</span><span class=\"token\">,</span>\n      <span class=\"token\">\"48\"</span><span class=\"token\">:</span> <span class=\"token\">\"icon48.png\"</span><span class=\"token\">,</span>\n      <span class=\"token\">\"128\"</span><span class=\"token\">:</span> <span class=\"token\">\"icon128.png\"</span>\n    <span class=\"token\">}</span>\n  <span class=\"token\">}</span>\n</code></div>\n<div class=\"flex\"><button class=\"btn btn-circle mt-n5\" type=\"submit\"></button><button class=\"btn btn-circle mt-n5\" type=\"submit\"></button><a class=\"fw-bold fs-6 text-white mt-n1\" href=\"https://www.phind.com/search?cache=yhj4j76idjyf7sbiuojnndpn\" target=\"_blank\" rel=\"noopener noreferrer\">\n<h6 class=\"text-always-white\">&nbsp;</h6>\n</a></div>\n</div>\n</div>\n<div class=\"fs-5\">\n<p class=\"text-black mb-2 text-break\">This manifest declares a background script (<code>background.js</code>), which will contain the logic for intercepting downloads. It also specifies the icons for the extension, which should be placed in the root directory of the extension&nbsp;<sup><a class=\"me-1\" href=\"https://medium.com/@inna.lynn/building-a-chrome-extension-that-logs-in-and-sends-a-url-to-your-server-75d5163fbf2d\" target=\"_blank\" rel=\"noopener noreferrer\">4</a></sup>.</p>\n</div>\n<div class=\"fs-5\">\n<ol class=\"mb-2\" start=\"2\">\n<li><strong>Create the Background Script</strong></li>\n</ol>\n</div>\n<div class=\"fs-5\">\n<p class=\"text-black mb-2 text-break\">The&nbsp;<code>background.js</code>&nbsp;script will listen for download events and display the URL of the downloaded file. Use the&nbsp;<code>chrome.downloads.onCreated</code>&nbsp;event to detect when a download begins:</p>\n</div>\n<div class=\"fs-5\">&nbsp;</div>\n<div class=\"fs-5\">\n<div class=\"mt-3 p-1\">\n<div><code class=\"language-javascript\">  chrome<span class=\"token\">.</span><span class=\"token property-access\">downloads</span><span class=\"token\">.</span><span class=\"token property-access\">onCreated</span><span class=\"token\">.</span><span class=\"token method property-access\">addListener</span><span class=\"token\">(</span><span class=\"token\">function</span><span class=\"token\">(</span><span class=\"token parameter\">downloadItem</span><span class=\"token\">)</span> <span class=\"token\">{</span>\n    <span class=\"token console\">console</span><span class=\"token\">.</span><span class=\"token method property-access\">log</span><span class=\"token\">(</span><span class=\"token\">\'Download started:\'</span><span class=\"token\">,</span> downloadItem<span class=\"token\">)</span><span class=\"token\">;</span>\n  <span class=\"token\">}</span><span class=\"token\">)</span><span class=\"token\">;</span>\n</code></div>\n<div class=\"flex\"><button class=\"btn btn-circle mt-n5\" type=\"submit\"></button><button class=\"btn btn-circle mt-n5\" type=\"submit\"></button><a class=\"fw-bold fs-6 text-white mt-n1\" href=\"https://www.phind.com/search?cache=yhj4j76idjyf7sbiuojnndpn\" target=\"_blank\" rel=\"noopener noreferrer\">\n<h6 class=\"text-always-white\">&nbsp;</h6>\n</a></div>\n</div>\n</div>\n<div class=\"fs-5\">\n<p class=\"text-black mb-2 text-break\">This will print a log message to the console whenever a download starts, including information about the download item, including its URL&nbsp;<sup><a class=\"me-1\" href=\"https://stackoverflow.com/questions/24848762/how-to-get-the-url-of-downloading-page-in-chrome-extension\" target=\"_blank\" rel=\"noopener noreferrer\">1</a></sup>.</p>\n</div>\n<div class=\"fs-5\">\n<ol class=\"mb-2\" start=\"3\">\n<li><strong>Display the URL</strong></li>\n</ol>\n</div>\n<div class=\"fs-5\">\n<p class=\"text-black mb-2 text-break\">To display the URL of the downloaded file, you can use the&nbsp;<code>chrome.notifications</code>&nbsp;API. First, add&nbsp;<code>\"notifications\"</code>&nbsp;to the&nbsp;<code>permissions</code>&nbsp;array in your&nbsp;<code>manifest.json</code>&nbsp;file. Then, modify the&nbsp;<code>background.js</code>&nbsp;script to send a notification with the download URL:</p>\n</div>\n<div class=\"fs-5\">&nbsp;</div>\n<div class=\"fs-5\">\n<div class=\"mt-3 p-1\">\n<div><code class=\"language-javascript\">  chrome<span class=\"token\">.</span><span class=\"token property-access\">downloads</span><span class=\"token\">.</span><span class=\"token property-access\">onCreated</span><span class=\"token\">.</span><span class=\"token method property-access\">addListener</span><span class=\"token\">(</span><span class=\"token\">function</span><span class=\"token\">(</span><span class=\"token parameter\">downloadItem</span><span class=\"token\">)</span> <span class=\"token\">{</span>\n    chrome<span class=\"token\">.</span><span class=\"token property-access\">notifications</span><span class=\"token\">.</span><span class=\"token method property-access\">create</span><span class=\"token\">(</span><span class=\"token\">{</span>\n      <span class=\"token literal-property\">type</span><span class=\"token\">:</span> <span class=\"token\">\'basic\'</span><span class=\"token\">,</span>\n      <span class=\"token literal-property\">iconUrl</span><span class=\"token\">:</span> <span class=\"token\">\'icon128.png\'</span><span class=\"token\">,</span>\n      <span class=\"token literal-property\">title</span><span class=\"token\">:</span> <span class=\"token\">\'Download Started\'</span><span class=\"token\">,</span>\n      <span class=\"token literal-property\">message</span><span class=\"token\">:</span> <span class=\"token\">\'Downloading from: \'</span> <span class=\"token\">+</span> downloadItem<span class=\"token\">.</span><span class=\"token property-access\">url</span>\n    <span class=\"token\">}</span><span class=\"token\">)</span><span class=\"token\">;</span>\n  <span class=\"token\">}</span><span class=\"token\">)</span><span class=\"token\">;</span>\n</code></div>\n<div class=\"flex\"><button class=\"btn btn-circle mt-n5\" type=\"submit\"></button><button class=\"btn btn-circle mt-n5\" type=\"submit\"></button><a class=\"fw-bold fs-6 text-white mt-n1\" href=\"https://www.phind.com/search?cache=yhj4j76idjyf7sbiuojnndpn\" target=\"_blank\" rel=\"noopener noreferrer\">\n<h6 class=\"text-always-white\">&nbsp;</h6>\n</a></div>\n</div>\n</div>\n<div class=\"fs-5\">\n<p class=\"text-black mb-2 text-break\">This will display a notification with the URL of the download whenever a download starts&nbsp;<sup><a class=\"me-1\" href=\"https://www.codeinwp.com/blog/how-to-write-a-chrome-extension/\" target=\"_blank\" rel=\"noopener noreferrer\">5</a></sup>.</p>\n</div>\n<div class=\"fs-5\">\n<p class=\"text-black mb-2 text-break\">Remember to replace&nbsp;<code>\'icon128.png\'</code> with the path to your actual icon image. Also, ensure that your icon images are located in the root directory of your extension.</p>\n</div>',0,NULL,1,'2024-01-06 20:10:00','2024-01-06 20:12:29',4),(23,'ANC Debug','<pre>closing -&gt; report -&gt; amend -&gt; include imigration fields in that section<br>ready for closing -&gt; reprint -&gt; edit -&gt; imigration<br>case fils -&gt; corp -&gt; chain cases<br><br><br><br><img src=\"data:image/png;base64,\" alt=\"\"><br><br><br><a href=\"https://devserviceddcaccessioning.feathersoft.local/api/v1/case-closing/regenerate?caseNo=2400001150\">https://devserviceddcaccessioning.feathersoft.local/api/v1/case-closing/regenerate?caseNo=2400001150</a><br><br>[{\"data\":{\"reference1\":\"CC282\",\"testParties\":[{\"testPartyId\":77831},{\"testPartyId\":77832},{\"testPartyId\":77833}],\"recipients\":[],\"caseId\":2400001151,\"interpretationError\":0,\"caseUpdate\":1,\"comment\":\"\",\"commentTypeId\":null,\"action\":\"AMEND\"}}]<br><br><br></pre>\n<div>\n<pre>Country immigCountry = getCountry(caseUpdateRequest.getImmigCountryIn());<br><br>----------------------------</pre>\n</div>\n<div>\n<pre>if (null != caseCreateRequest.getImmigRequestType())<br>  cases.setImmigRequestType(<br>      immigrationService.getById(caseCreateRequest.getImmigRequestType()));<br>cases.setImmigFileNo(caseCreateRequest.getImmigFileNo());<br>if (null != caseCreateRequest.getImmigRequestSubType()) {<br>  cases.setImmigRequestSubType(<br>      immigrationService.getImmigrationSubType(caseCreateRequest.getImmigRequestSubType()));<br>}<br>cases.setImmigNataComment(caseCreateRequest.getImmigNataComment());</pre>\n</div>\n<pre><br>existing chain case update payload<br><br></pre>\n<ol class=\"children expanded\" role=\"group\">\n<li class=\"force-white-icons selected\" tabindex=\"0\" role=\"tr